  \"Structural Composites with Intrinsic Multifunctionality Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:05:23.108100\",\n\t\"name\": \"structural-composites-with-intrinsic-multifunctionality-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Development of multifunctional, structural
  materials for applications in terrestrial and space-based platforms is proposed.
  \ The principle innovation is the development of an epoxy-based thermoset that undergoes
  a phase separation reaction during cure to form interpenetrating networks (IPN)
  of a structural thermoset (epoxy) phase and a second phase that is tailored to provide
  ancillary function.  Both phases are co-continuous and nano-structured, having typical
  dimensions of 40-200nm.  The second phase has controllable viscoelastic properties
  to provide mechanical damping and other strain-rate dependent behavior.  Additional
  functionality is obtained by sequestering appropriate materials into the second
  phase.  Examples include ionizable salts to provide ionic conductivity, reducible
  and oxidizable materials for power source applications and reactive species for
  composite self-repair.  In the phase I, the IPN epoxy was used as a matrix for graphite
  fiber reinforced composites.  Within this matrix material, a novel mechanism for
  vibration damping was revealed and reactive oligomers for self-repair were successfully
  incorporated without loss of reactivity.  Internal electrochemical reactions, which
  can be used for electrical power generation and myriad other applications, were
  demonstrated. In the phase II, high performance IPN epoxies, capable of extended
  service at 150??C and above will be developed and optimized for vibration damping
  and self-repair functionality.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
